import React, {Component} from 'react';
import { Link } from "react-router-dom";
import { makeStyles } from '@material-ui/core/styles';
import { AppBar, Typography, Toolbar, Tabs, Tab, Box, IconButton, Grid } from '@material-ui/core';
import Paper from "@material-ui/core/Paper";

function a11yProps(index) {
    return {
        id: `simple-tab-${index}`,
        'aria-controls': `simple-tabpanel-${index}`,
    };
}

const useStyles = makeStyles({
    root: {
        flexGrow: 1,
    },
    button: {

    }
});
export default function Menu() {
    const classes = useStyles();
    const [value, setValue] = React.useState(0);

    const handleChange = (event, newValue) => {
        setValue(newValue);
    };

    return (
        <Paper className={classes.root}>
            <Tabs
                // value={value}
                // indicatorColor="primary"
                // textColor="primary"
                // onChange={handleChange}
                // aria-label="disabled tabs example"
                // centered

                value={value}
                indicatorColor="primary"
                textColor="primary"
                onChange={handleChange}
                aria-label="disabled tabs example"
            >
                <Link to={'/'} {...a11yProps(0)}><Tab label="Intro" /></ Link>
                <Link to={'/about'} {...a11yProps(1)}><Tab label="About" /></ Link>
                <Link to={'/contact'} {...a11yProps(2)}><Tab label="Contact" /></ Link>
                <Link to={'/auth'} {...a11yProps(3)}><Tab label="Login" /></ Link>
                <Link to={'/edition'} {...a11yProps(4)}><Tab label="Edition" /></ Link>

            </Tabs>
        </Paper>
    );
}
